from aldegonde.analysis.friedman import friedman_test, interrupted_slices

"""
"""

TXT = """"""  # noqa: E501

#         012012340123
TXT2 = """CVJAFENMHGSO"""


def test_friedman() -> None:
    friedman_test(TXT)


def test_interrupted_slices() -> None:
    slices = {
        0: ["C", "A", "H"],
        1: ["V", "F", "G"],
        2: ["J", "E", "S"],
        3: ["N", "O"],
        4: ["M"],
    }
    assert interrupted_slices(TXT2, 5, interrupter="A") == slices
